@want90sback Rapid weight loss ‚â† Fat loss. 

Losing half an inch around the belly is not rapid weight loss. 

Rapid weight loss is when a person has some disease, like TB or cancer and loses kgs within days.

Common symptoms of Tuberculosis are prolonged cough (sometimes with blood), chest pain, weakness, fatigue, weight loss, fever, night sweats, etc.

Also, the symptoms depend on where in the body TB becomes active. While TB usually affects the lungs, it also affects the kidneys, brain, spine and skin.

